import './App.css';
import Heading from './components/Heading';
import Card from './components/Card';
import Avatar from './components/Avatar';

const contacts = [
  {
    name: 'Beyonce',
    telephone: '+123 456 789',
    email: 'b@beyonce.com',
    img: 'https://blackhistorywall.files.wordpress.com/2010/02/picture-device-independent-bitmap-119.jpg',
  },
  {
    name: 'Jack Bauer',
    telephone: '+987 654 321',
    email: 'jack@nowhere.com',
    img: 'https://pbs.twimg.com/profile_images/625247595825246208/X3XLea04_400x400.jpg',
  },
  {
    name: 'Chuck Norris',
    telephone: '+918 372 574',
    email: 'gmail@chucknorris.com',
    img: 'https://i.pinimg.com/originals/e3/94/47/e39447de921955826b1e498ccf9a39af.png',
  },
];
function App() {
  return (
    <div style={{ backgroundColor: '#dfe6e9' }}>
      <header>
        <Heading />
        <Avatar img="https://scontent.ftlv26-1.fna.fbcdn.net/v/t39.30808-6/274718622_3100878150163585_7390655278183067356_n.jpg?_nc_cat=100&ccb=1-7&_nc_sid=6ee11a&_nc_ohc=hz58ANVcbawQ7kNvgEQwRL1&_nc_ht=scontent.ftlv26-1.fna&oh=00_AYDXuqmigZC89z7XpDyNsXwn4FiTiEGJl4vurTy1mI3K0Q&oe=66D92508" />
      </header>
      <div className="body">
        {contacts.map(function (contact) {
          return (
            <Card
              name={contact.name}
              telephone={contact.telephone}
              email={contact.email}
              img={contact.img}
            />
          );
        })}
      </div>
    </div>
  );
}

export default App;
